import React from 'react';
import { motion } from 'framer-motion';
import { useInView } from 'react-intersection-observer';
import { Play, ExternalLink, Music as MusicIcon } from 'lucide-react';

const Music = () => {
  const [ref, inView] = useInView({
    triggerOnce: true,
    threshold: 0.1,
  });

  const tracks = [
    // Add your tracks here. Example:
    // {
    //   title: "Track Title",
    //   cover: "cover-image-url",
    //   spotifyUrl: "https://open.spotify.com/track/yourtrackid",
    //   soundcloudUrl: "https://soundcloud.com/felixfalken/yourtrackname",
    // },
  ];

  const containerVariants = {
    hidden: { opacity: 0 },
    visible: {
      opacity: 1,
      transition: {
        staggerChildren: 0.2,
      },
    },
  };

  const itemVariants = {
    hidden: { opacity: 0, y: 50 },
    visible: {
      opacity: 1,
      y: 0,
      transition: {
        duration: 0.6,
      },
    },
  };

  return (
    <section id="music" className="section-padding bg-cyber-dark">
      <div className="container-custom">
        <motion.div
          ref={ref}
          initial="hidden"
          animate={inView ? "visible" : "hidden"}
          variants={containerVariants}
          className="text-center mb-16"
        >
          <motion.h2
            variants={itemVariants}
            className="text-4xl md:text-6xl font-anton text-cyber-white mb-6 tracking-wider"
          >
            MUSIC
          </motion.h2>
          <motion.p
            variants={itemVariants}
            className="text-xl text-cyber-white/80 max-w-2xl mx-auto"
          >
            Explore my latest electronic compositions and sonic experiments
          </motion.p>
        </motion.div>

        <motion.div
          variants={containerVariants}
          initial="hidden"
          animate={inView ? "visible" : "hidden"}
          className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-2 gap-8"
        >
          {tracks.map((track, index) => (
            <motion.div
              key={track.id}
              variants={itemVariants}
              whileHover={{ scale: 1.02 }}
              className="bg-cyber-gray/50 backdrop-blur-sm border border-cyber-gray rounded-lg overflow-hidden hover:border-cyber-cyan/50 transition-all duration-300"
            >
              {/* Track Cover */}
              <div className="relative h-48 overflow-hidden">
                <img
                  src={track.cover}
                  alt={track.title}
                  className="w-full h-full object-cover transition-transform duration-300 hover:scale-110"
                />
                <div className="absolute inset-0 bg-black/20 flex items-center justify-center">
                  <motion.button
                    whileHover={{ scale: 1.1 }}
                    whileTap={{ scale: 0.9 }}
                    className="w-16 h-16 bg-cyber-cyan/90 rounded-full flex items-center justify-center hover:bg-cyber-cyan transition-colors duration-300"
                  >
                    <Play className="w-8 h-8 text-cyber-black ml-1" />
                  </motion.button>
                </div>
              </div>

              {/* Track Info */}
              <div className="p-6">
                <div className="flex items-start justify-between mb-4">
                  <div>
                    <h3 className="text-xl font-bold text-cyber-white mb-2">
                      {track.title}
                    </h3>
                    <p className="text-cyber-white/70 text-sm mb-3">
                      {track.description}
                    </p>
                  </div>
                  <span className="text-cyber-cyan text-sm font-mono">
                    {track.duration}
                  </span>
                </div>

                {/* Genre Tag */}
                <div className="flex items-center justify-between mb-4">
                  <span className="px-3 py-1 bg-cyber-cyan/20 text-cyber-cyan text-xs font-bold rounded-full border border-cyber-cyan/30">
                    {track.genre}
                  </span>
                </div>

                {/* Platform Links */}
                <div className="flex gap-3">
                  <motion.a
                    href={track.spotifyUrl}
                    target="_blank"
                    rel="noopener noreferrer"
                    whileHover={{ scale: 1.05 }}
                    whileTap={{ scale: 0.95 }}
                    className="flex-1 bg-cyber-cyan text-cyber-black py-2 px-4 rounded font-bold text-sm flex items-center justify-center hover:bg-cyber-cyan/80 transition-colors duration-300"
                  >
                    <MusicIcon className="w-4 h-4 mr-2" />
                    Spotify
                  </motion.a>
                  <motion.a
                    href={track.soundcloudUrl}
                    target="_blank"
                    rel="noopener noreferrer"
                    whileHover={{ scale: 1.05 }}
                    whileTap={{ scale: 0.95 }}
                    className="flex-1 bg-cyber-pink text-cyber-black py-2 px-4 rounded font-bold text-sm flex items-center justify-center hover:bg-cyber-pink/80 transition-colors duration-300"
                  >
                    <ExternalLink className="w-4 h-4 mr-2" />
                    SoundCloud
                  </motion.a>
                </div>
              </div>
            </motion.div>
          ))}
        </motion.div>

        {/* Call to Action */}
        <motion.div
          variants={itemVariants}
          initial="hidden"
          animate={inView ? "visible" : "hidden"}
          className="text-center mt-16"
        >
          <motion.a
            href="https://open.spotify.com/artist/example"
            target="_blank"
            rel="noopener noreferrer"
            whileHover={{ scale: 1.05 }}
            whileTap={{ scale: 0.95 }}
            className="cyber-button inline-flex items-center"
          >
            <ExternalLink className="w-5 h-5 mr-2" />
            Follow on Spotify
          </motion.a>
        </motion.div>
      </div>
    </section>
  );
};

export default Music;
